import React from 'react';


const Contact = () => {
    return (
        <>
          <div className="main_div">
              <div className="inner_div">
              <form>
                  <input type="text" placeholder="Name" />
                  <input type="text" placeholder="Email-Id" />
                  <input type="text" placeholder="Message" />
                  <input type="Submit" />
             </form>
              </div>
          </div>
        </>
    )
}

export default Contact;


